#include <iostream>
#include <vector>

using namespace std;

struct Node {
    int key;
    Node* left;
    Node* right;
    Node* parent;
};

class BinarySearchTree {
public:
    Node* root;

    BinarySearchTree() {
        root = nullptr;
    }

    void insert(int key) {
        Node* z = new Node();
        z->key = key;
        z->left = nullptr;
        z->right = nullptr;
        z->parent = nullptr;

        Node* y = nullptr;
        Node* x = root;

        while (x != nullptr) {
            y = x;
            if (z->key < x->key) {
                x = x->left;
            } else {
                x = x->right;
            }
        }

        z->parent = y;
        if (y == nullptr) {
            root = z;
        } else if (z->key < y->key) {
            y->left = z;
        } else {
            y->right = z;
        }
    }

    void inorder(Node* node, vector<int>& keys) {
        if (node != nullptr) {
            inorder(node->left, keys);
            keys.push_back(node->key);
            inorder(node->right, keys);
        }
    }

    void preorder(Node* node, vector<int>& keys) {
        if (node != nullptr) {
            keys.push_back(node->key);
            preorder(node->left, keys);
            preorder(node->right, keys);
        }
    }

    void print() {
        vector<int> inorderKeys;
        inorder(root, inorderKeys);
        vector<int> preorderKeys;
        preorder(root, preorderKeys);
        for (int key : inorderKeys) {
            cout << key << " ";
        }
        cout << endl;
        for (int key : preorderKeys) {
            cout << key << " ";
        }
        cout << endl;
    }
};

int main() {
    int m;
    cin >> m;
    BinarySearchTree bst;
    for (int i = 0; i < m; i++) {
        string op;
        int key;
        cin >> op;
        if (op == "insert") {
            cin >> key;
            bst.insert(key);
        } else if (op == "print") {
            bst.print();
        }
    }
    return 0;
}
